To terminate a C program, you can use the `exit()` function. This function takes one argument, which is an integer value. The value can be any non-negative integer, and it specifies the exit status code that is returned to the parent process.

Here's an example of how to use `exit()` to terminate a C program:
```
#include <stdio.h>

int main() {
    // Do some work here...

    // When you're done, use exit() to terminate the program
    exit(0);
}
```
When the `exit()` function is called, the program will exit immediately, and the operating system will perform any necessary cleanup. The exit status code is returned to the parent process, which can be used to determine whether the program terminated successfully or encountered an error.

You can also use the `return` statement to terminate a function and return control to the calling function. However, this is not a good way to terminate a program as a whole, because the calling function will continue to run and may cause the program to behave unexpectedly.</s>
